import React from "react";
import { BigPlayButton, LoadingSpinner, Player, ControlBar } from "video-react";
import "../../../node_modules/video-react/dist/video-react.css";
import Helmet from "react-helmet";
import { render } from "react-dom";

export default Watch => {
  const style = {
    marginTop: "100px"
  };
  const float = {
    float: "left",
    marginTop: "50px"
  };
  return (
    <div style={style}>
      <div style={float}>
        <Helmet
          bodyAttributes={{
            style: "backgroundImage: url('./images/textureBackgroun.png')"
          }}
        />
        <Player
          style={float}
          playsInline
          fluid={false}
          width={500}
          height={250}
          poster="https://song-253.s3.amazonaws.com/image/bluehour.png"
          src="https://song-253.s3.amazonaws.com/video/BlueHour.mp4"
        >
          <BigPlayButton position="center" />
          <LoadingSpinner />
          <ControlBar width={500} />
        </Player>
      </div>
      <div style={float}>
        <Player
          style={float}
          playsInline
          fluid={false}
          width={500}
          height={250}
          poster="./images/curse.png"
          src="https://song-253.s3.amazonaws.com/video/GracefulShadows.mp4"
        >
          <BigPlayButton position="center" />
          <LoadingSpinner />
          <ControlBar width={500} />
        </Player>
      </div>
    </div>
  );
};
